local imgui = require("mimgui")

gnomeIcons.loadIcons = function(iconSize)
    local config = imgui.ImFontConfig()
    local glyph_ranges = imgui.GetIO().Fonts:GetGlyphRangesCyrillic()
    local iconRanges = imgui.new.ImWchar[3](0xe005, 0xf8ff, 0)
    
    config.MergeMode = true
    imgui.GetIO().Fonts:AddFontFromFileTTF("trebucbd.ttf", iconSize or 14.0, nil, glyph_ranges)
    icon = imgui.GetIO().Fonts:AddFontFromMemoryCompressedBase85TTF(compressedGnomeIconsFont, iconSize or 14.0, config, iconRanges)
end

local function unicodeToUtf8(code)
   local t, h = {}, 128
   while code >= h do
      t[#t + 1] = 128 + code % 64
      code = math.floor(code / 64)
      h = h > 32 and 32 or h / 2
   end
   t[#t + 1] = 256 - 2 * h + code
   return string.char(unpack(t)):reverse()
end

setmetatable(gnomeIcons, {
	__call = function(t, v)
		if (type(v) == "string") then
			return t["ICON_"..v:upper()] or "?"
		elseif (type(v) == "number" and v >= MIN_ICON and v <= MAX_ICON) then
			return unicodeToUtf8(v)
		end
		return "Unknown icon"
	end,

	__index = function(t, i)
		if type(i) == "string" then
			if i == "min_range" then
				return MIN_ICON
			elseif i == "max_range" then
				return MAX_ICON
			end
		end

		return t[i]
	end
})

return gnomeIcons
